Join me this fall in Italy at my the Dolomites Expedition! The mountain peaks and ranges of the Dolomites are unlike any others! Honestly pictures and videos just don’t do this place justice. It really is a place you need to see in person! And what better way to do this then by exploring with me and taking some killer images along the way! 
  It’s happening this Sep 9-12 and there are only 5 spots left! Follow the link in my bio to get more details and grab your spot! 
